settings.cardCss:
body {
  margin: 0;
  font-family: Arial, sans-serif;
}

.container {
  display: grid;
  grid-template-columns: 1fr 3fr;
  grid-template-rows: auto 1fr auto;
  height: 100vh;
}

.sidebar {
  background: #f4f4f4;
  padding: 20px;
  overflow-y: auto;
}

.sidebar h2 {
  margin: 0;
  padding: 10px 0;
}

.sidebar ul {
  list-style: none;
  padding: 0;
}

.sidebar ul li {
  margin: 10px 0;
}

.sidebar ul li ul {
  padding-left: 20px;
  margin-top: 5px;
}

.main-content {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.building-display img {
  width: 300px;
  height: auto;
}

.floor-buttons {
  margin-top: 20px;
}

.floor-buttons button {
  margin: 5px;
  padding: 10px 15px;
  background: #ddd;
  border: none;
  cursor: pointer;
}

.floor-buttons button:hover {
  background: #ccc;
}

.search-bar {
  grid-column: span 2;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px;
  background: #f9f9f9;
}

.search-bar input {
  padding: 5px;
  width: 300px;
  border: 1px solid #ccc;
  border-radius: 3px;
}

.search-bar button {
  padding: 5px 10px;
  margin-left: 5px;
  background: #ddd;
  border: none;
  cursor: pointer;
}

.device-status {
  display: flex;
  justify-content: space-around;
  align-items: center;
  padding: 20px;
  background-color: #f9f9f9;
  border-top: 1px solid #ccc;
}

.online-icon-container {
  display: flex;
  align-items: center;
  gap: 10px;
}

.online-icon {
  position: relative;
  width: 20px;
  height: 20px;
}

