.online-icon .dot {
  position: absolute;
  top: 25%;
  left: 25%;
  width: 50%;
  height: 50%;
  background-color: #00ff00;
  border-radius: 50%;
}

.status-text {
  font-size: 16px;
  color: #333;
  font-weight: bold;
}

/* .online-icon.offline .pulse {
  background-color: rgba(255, 0, 0, 0.3);
} */

.online-icon.offline .dot {
  background-color: #ff0000;
}

@keyframes pulse {
  0% {
    transform: scale(1);
    opacity: 1;
  }
  50% {
    transform: scale(1.5);
    opacity: 0.5;
  }
  100% {
    transform: scale(2);
    opacity: 0;
  }
}
